import React from 'react';
import { LoginSocialFacebook, LoginSocialInstagram, LoginSocialTiktok } from 'reactjs-social-login'
import { InstagramLoginButton } from 'react-social-login-buttons'
import { state, useState, useCallback } from 'react'

function Brandlandingpage() {

  const [provider, setProvider] = useState('')
  const [profile, setProfile] = useState(null)
  const REDIRECT_URI = window.location.href;

  const onLoginStart = useCallback(() => {
    alert('login start')
  }, [])

  const onLogoutSuccess = useCallback(() => {
    setProfile(null)
    setProvider('')
    alert('logout success')
  }, [])

  return (
    <>
      <div>Brand Landing Pagess
        <LoginSocialInstagram
          isOnlyGetToken
          client_id={'6342324939180545' || ''}
          client_secret={'97c5aae4b141556dc129320719313aea' || ''}
          redirect_uri={'https://brandaffy.onrender.com/'}
          onLoginStart={onLoginStart}
          onResolve={({ provider, data }) => {
            setProvider(provider)
            setProfile(data)
          }}
          onReject={(err) => {
            console.log(err)
          }}
        >
          <InstagramLoginButton />
        </LoginSocialInstagram>

      </div>
      <LoginSocialTiktok
        client_key={'process.env.REACT_APP_TIKTOK_CLIENT_KEY'}
        redirect_uri={REDIRECT_URI}
        onLoginStart={onLoginStart}
        onResolve={({ provider, data }) => {
          setProvider(provider);
          setProfile(data);
          console.log(data);
          console.log(provider)
        }}
        onReject={(err) => {
          console.log(err);
        }}
        className="pinterest-btn"
      >
        <div className="content">
          <div className="icon">
          </div>
          <span className="txt">Login With Tiktok</span>
        </div>
      </LoginSocialTiktok>
    </>
  )
}

export default Brandlandingpage
